import React from 'react'
import { Card , Button } from 'react-bootstrap';
import classNames from 'classnames';


const CardMenu = (props) => {
  const { src, title, cardCor, cardON, cardOFF, btnON, btnOFF } = props;
  const cardClasses = `col-3 pt-3 rounded-3 ${cardON} ${cardOFF} ${cardCor}`;
  const buttonClasses = `${btnON} ${btnOFF} ${cardCor}`;


  
  return (
    <Card className={cardClasses} style={{ width: '15rem', height:  '17rem' }}>
      <Card.Img src={src} alt="..." style={{ width: '10rem', alignSelf: 'center'}} />
      <Card.Body>
        <Card.Title>{title}</Card.Title>
        <Button className={buttonClasses}>Acesse</Button>
      </Card.Body>
    </Card>
  );
}

export default CardMenu
